import React from "react";
import styled from "styled-components";
import { SmallSubtitle, FatTitle, Labor } from "../styled/typos";
const member = props => {
  const { dataMember } = props;

  return (
    <Container>
      <SmallSubtitle>{dataMember.subTitle}</SmallSubtitle>
      <FatTitle>{dataMember.name}</FatTitle>
      <Line />
      <Labor>{dataMember.description}</Labor>
    </Container>
  );
};

export default member;

const Container = styled.div`
  position: relative;
`;

const Line = styled.hr`
  border: 0.5px solid ${props => props.theme.colors.white};
  transform: rotate(90deg);
  width: 115px;
`;
